When #covid19 began to peak in #India, the country faced shortages of testing kits, lack of PPE, and hotspots in populated areas. The 
@actioncovidteam
 provided catalytic funding that helped the country gear up to fight the virus.

Waxing gibbous moon symbol ICYMI... using our 
@SOFIATelescope
, we found water on the Moon's sunlit surface for the first time. Scientists think the water could be stored inside glass beadlike structures within the soil that can be smaller than the tip of a pencil. A recap: https://go.nasa.gov/2HFTZbw

