In case you missed it: last night, 3 space travelers including Chris Cassidy (
@Astro_SEAL
) departed the 
@Space_Station
 after 196 days in space, safely landing back on Earth. Cassidy completed a total of 4 spacewalks on this mission, his 3rd spaceflight: https://go.nasa.gov/3obMZUt
